import React from "react";

import AddressView from "../addressView";

const AddressList = ( props ) =>{

    const { data } = props

    return (<div>
        {data.length ? 
        data.map((el,index)=><AddressView data={el} key={el.id} number={index}/>)
        :''}
    </div>)
}

export default AddressList
